import React from 'react';

export default function Header() {
    return (
        <div className='topNavbar'>
            <div><h1>Wendell Fowlkes</h1>
            
            <div>
                <a>Home</a>
                <a>About Me</a>
                <a>Portfolio</a>
                <a>Contact</a>
            </div>
            </div>

        </div>
    )
}
